  \"2015-06-29T17:49:05.221229\",\n\t\"name\": \"i-94-automation-faqs\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In order to increase efficiency, reduce
  operating costs and streamline the admissions process, U.S. Customs and Border Protection
  has automated Form I-94 at air and sea ports of entry. The paper form will no longer
